import { createAsyncThunk } from "@reduxjs/toolkit";

export const postSignup = createAsyncThunk(
  "rootReducer/postSignup",
  async ({ username, email, password }) => {
    const response = await fetch("/signup", {
      method: "POST",
      body: { data: "dataporra" },
    });
    return await response.json();
  }
);
